angular.module("ez.tabs").run(["$templateCache",function(a){"use strict";a.put("ez-tabs.html",'<div>\n  <ul class="nav nav-tabs">\n    <li ng-repeat="tab in tabs" ng-if="tab.show" ng-class="{active: tab.active}">\n      <a ng-click="select(tab)" ng-bind-html="tab.heading"></a>\n    </li>\n  </ul>\n  <div class="tab-content">\n    <div class="tab-pane active"></div>\n  </div>\n</div>\n')}]);